import Card from "../UI/Card/card";
import classes from './QuizCard.module.css';
import CardIcon from '../../assets/Card-icon.svg';
import coin from '../../assets/coin.png';
const QuizCard = () => {

    const CardHeder = (
        <>
            <h5>Entry:100</h5>
            <badge className={classes.badge}><ul><li>Live</li></ul></badge>
        </>
    )

    const CardBody = (
        <>
        <div className={classes.imgIcon}>
            <img src={CardIcon} alt="Card Image"/>
        </div>
        <div className={classes.content}>
            <h5>English Grammer</h5>
            <h3>Play and Win 200,000 <img src={coin} alt="coin"/></h3>
            <small>Winner announcement: 03:30 PM</small>
        </div>
        </>
    )


    return (
        <Card>
            <div className={classes.cardheader}>
                {CardHeder}
            </div>
            <div className={classes.cardbody}>
                {CardBody}
            </div>

        </Card>
    )
}
export default QuizCard;
